    const dispatch=useDispatch()
    let afichage=useSelector((data)=>data.table.tbl)
    const[nomP,setnomP]=useState()
    const[prix,setPrix]=useState()
    
  return (
    <div>
        <input type='text'/>
        <input type='text' />
        <button>Ajouter</button><br/>
        <table>
            <tr>
                <th>nom produis</th>
                <th>prix produis</th>
                <th>Action</th>
            </tr>
            {afichage?afichage.map((r)=>{
                return <tr>
                    <td>{r.nomP}</td>
                    <td>{r.prixP}</td>
                    <td><button>Delete</button></td>
                </tr>
            }):''}
        </table>
    </div>
  )
}
